INSERT INTO `events_mainevent` VALUES (7,'The Potter Quiz','<p>NA</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'NA',11),(8,'TURNCOAT','<p style=\"margin-left:0cm; margin-right:0cm\"><span style=\"background-color:white\"><span style=\"background-color:white\"><span style=\"color:black\">Turncoat is a rhetoric event where the speakers contradict themselves. The speaker starts by taking a stance on the topic and switches sides after a specific duration of time. </span></span></span></p>\r\n\r\n<p style=\"margin-left:0cm; margin-right:0cm\">&nbsp;</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Yash Goswami  8505028076',7),(13,'RapWars','<p>Witness one of India&#39;s largest college-level rap battle competitions as RapWars enters its seventh edition. With better participants and amazing performances, RapWars is an event you don&#39;t want to miss.</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Sashank 6375352568',2),(15,'OTAKU(ANIME QUIZ)','<p>NA</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'NA',11),(19,'Wordstock','<p><span style=\"color:#f44336\"><span style=\"color:#000000\">Think you can play with the English language? This event is sure to make you eat your words with a handful of crosswords, rebuses and Tom Swifties taking you to your wits&#39; end. Crack &#39;em and be crowned the king of words.&nbsp;</span></span></p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Aditya Vasudevan  78750 35855',12),(20,'Word Wars','<p style=\"margin-left:0cm; margin-right:0cm\"><span style=\"color:black\">Words were never so much fun. In this crazy maze of words, letters, phrases and sentences, hone your skills and revamp your enthusiasm of discovering simple things. </span></p>\r\n\r\n<p>It is a fun event comprising of different forms of word games, from riddles to spellathons and simple spell checks.</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Nimisha Jain  9414177993, 9610478244',12),(21,'Speed Scrabble','<p><span style=\"color:#f44336\"><span style=\"color:#000000\">Speed Scrabble is a fun take on the traditional board game. The objective is to think fast and make effective use of the tiles given to you. Finish your move as quickly as possible to stay in the game.</span></span></p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Aditya Vasudevan 78750 35855',12),(22,'Theme Quiz','<p><span style=\"color:#222222\"><span style=\"background-color:#ffffff\"><span style=\"color:#f44336\"><span style=\"color:#000000\">A thematic quiz based on the theme of Oasis &ndash; &ldquo;Far Out Fest&rdquo;. It will include questions from the multitude of topics that come under &ldquo;Counter-culture&rdquo;.</span></span></span></span></p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Naveen Unnikrishnan 98470 99907',11),(23,'Scifi Quiz','<p>NA</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'NA',11),(24,'Oasis Quiz','<p><span style=\"color:#f44336\"><span style=\"color:#000000\">A quiz about anything and everything, hosted by renowned quizmaster Kushan Patel. It is a general quiz.</span></span></p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Naveen Unnikrishnan  98470 99907',11),(25,'Music Quiz','<p><span style=\"color:#222222\"><span style=\"background-color:#ffffff\"><span style=\"color:#f44336\"><span style=\"color:#000000\">Do you consider yourself a Maestro of Music? Test your music trivia in the Music Quiz. From Pop, Rock, and Classical to Video game themes, anything about music can be asked in this quiz. </span><span style=\"color:#000000\">.</span></span></span></span></p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Naveen Unnikrishnan  98470 99907',11),(26,'Filmy Muqabla','<p>Filmy Muqabla is a quizzing event with questions geared towards bollywood movies. The questions can be on anything related to a movie released under bollywood banner. It has rounds on images, characters, scenes, dialogues and anagrams.<br />\r\nIt is the perfect place for bollywood fans who have a liking for quizzing</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Atharva- 7240321666 , Nikunj- 9426061037 , Shrishti- 8875210001',11),(27,'Entertainment Quiz','<p style=\"margin-left:0cm; margin-right:0cm\">Not your everyday quiz. Test out that spontaneous part of your brain, make crazy guesses, and surprisingly, win!</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Saurav Shenoy  9620900995',11),(28,'Online Quiz','<p>NA</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'NA',11),(29,'Blab','<p style=\"margin-left:0cm; margin-right:0cm\"><span style=\"color:black\">BITS Language Aptitude Battle based on the hit BBC show Just-A-Minute. </span></p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Aditya Patil - 9665874991',11),(30,'Antakshari','<p>This is a bollywood song quiz for music enthusiasts inspired by the show named &lsquo;Antakshari by Anu Kapoor&rsquo; aired during 90s. Antakshari is not just a platform with lyrics, it&rsquo;s an event which will lift up your mood and entertain you through musical quiz.</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Anshuman- 9899632278 , Ruchi- 8107207329 , Ujjwal- 8708743131',11),(31,'Oasis through my eyes','<p><span style=\"color:#f44336\"><span style=\"color:black\"><span style=\"color:#222222\">Capture Oasis, a non stop 96 hours event, in all it&#39;s glory and action.</span>&nbsp;</span></span></p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Tanay Sah  9461846336',10),(32,'Exposure','<p style=\"margin-left:0cm; margin-right:0cm\"><span style=\"color:black\">Annual online photography exhibition-cum-competition in association with Indian Institute of Photography and The Youth Chronicles</span></p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Tanay Sah  9461846336',10),(33,'Wit in a Minute','<p>NA</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'NA',7),(34,'Taboo','<p>NA</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'NA',7),(35,'Standup Soapbox','<p style=\"margin-left:0cm; margin-right:0cm\">Standup Soapbox is a one of a kind event that provides a platform for upcoming stand-up comedians to showcase their talent. Aspiring stand-up comedians get the opportunity to travel to BITS, Pilani after clearing the elimination round to perform in one of India&rsquo;s biggest cultural fest, OASIS</p>\r\n\r\n<p>Standup Soapbox gives way to the red carpet, as the winner gets the chance to perform, on stage, in the presence of 1500 people alongside the big names of Indian comedy in &lsquo;N2O&rsquo;, the show that boasts the country&rsquo;s premier standup comedians and comedy troupes. That&rsquo;s right, Standup Soapbox is your chance to open the night that gives way to comedians of the stature of Abhishek Upmanyu and Jaspreet Singh</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Sachin 7891805969',7),(36,'Pun Wars','<p><span style=\"color:#f44336\"><span style=\"color:#000000\"><span style=\"color:#000000\"><span style=\"color:#222222\">Taking the ancient art of verbal battles and savagery forward, Pun Wars is a battle of wordplay, creativity and spontaneity.</span></span></span></span></p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Devansh 7987023229',13),(37,'Purple Prose','<p>For the very first time Oasis presents to you, Purple Prose- The Poetry Slam, a nationwide slam poetry competition. Purple Prose is the best stage for the moulders of words to share their stories, ideas and notions meanwhile bagging the title of best slam poet</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Sachin 7891805969',7),(38,'Mock Parliament','<p><span style=\"color:#f44336\"><span style=\"color:#000000\"><span style=\"color:#000000\">Mock Parliament is an event that is aimed at bringing out the debater in you because we believe that every &ldquo;Indian&rdquo; has an opinion on the current political scene. </span></span></span></p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Tanmay Khandelwal-7340696967 , Shefali Tripathi-9119225442  ,Tanmay Moghe-8698130241',7),(39,'Competitive Contact','<p>NA</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'NA',7),(40,'Cocktail','<p style=\"margin-left:0cm; margin-right:0cm\"><span style=\"color:black\">More than knowledge of the Hindi as a language, Cocktail demands wit and presence of mind. A scintillating reinvention of Acting, Random Speaking and Unconventional Debating, it promises to remind you of your school days. </span></p>\r\n\r\n<p>With five thrilling rounds challenging finalists to explore new flavours, this event will surely leave both the participants and the audience brimming with fun and excitement. Enjoy the &lsquo;Cocktail&rsquo;</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Nimisha Jain  9414177993, 9610478244',7),(41,'Bluffmaster','<p style=\"margin-left:0cm; margin-right:0cm\"><span style=\"background-color:white\"><span style=\"color:#222222\">&#39;Bluff&#39; had never been this interesting. Think of some out of the box answers for the weirdest of questions, and &#39;bluff&#39; your way out to be the &#39;BLUFFMASTER&#39;. An event full of fun, frolic and extravaganza, all packed up in a series of questions.</span></span></p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Nimisha Jain  9414177993, 9610478244',7),(42,'Tarang','<p><span style=\"background-color:#ffffff\"><span style=\"color:#f44336\"><span style=\"color:#000000\">Tarang &ndash; a musical extravaganza from the Indian heartland. Come as a band and the stage is yours.</span></span></span></p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Megha  +91-9461249831',2),(43,'Swaranjali','<p><span style=\"background-color:#ffffff\"><span style=\"color:#f44336\"><span style=\"color:#000000\">Swaranjali is a classical music contest. Participants trained in the vocal and instrumental aspects of both Carnatic and Hindustani styles are invited to compete. (Instruments: violin, sitar, veena, flute, Hawaiian guitar, tabla, mridangam, ghatam, keyboard, harmonium, kanjira, sarangi and sarod.)</span></span></span></p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Chirag Pathak- +91-9131984337 , Megha Paliwal- +91-8209147411 ,+91-8955464507',2),(44,'Rocktaves','<p style=\"margin-left:0cm; margin-right:0cm\">One of the oldest band competition in India which has acted as a springboard for India&rsquo;s premiere rock groups of the stature of Parikrama, Indian Ocean, Superfuzz, PRESTORIKA, Them Clones and Euphoria who have taken part in the competition at different points in its history.</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Pankaj Tawale - +918830196330 , +917689078289 , Khushboo Kohli - +917045958749',2),(45,'Pitch Perfect','<p><span style=\"background-color:#ffffff\"><span style=\"color:#f44336\"><span style=\"color:#000000\">Pitch Perfect is the platform for a growing crowd of Cappella enthusiasts to face off against each other.</span></span></span></p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Krishnadev  +91-7902811820.',2),(46,'Free Jam','<p>NA</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'NA',2),(47,'Drums Duel','<p style=\"margin-left:0cm; margin-right:0cm\">It is an event in which drummers are short listed on the basis of their drum playing proficiency and creativity by the means of ear testing, playing dynamics and style choice. After that the shortlisted drummers &#39;duel&#39; alternatively to see who has the better approach in elevating a mundane beat.</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Anvesh bhattacharya 9116702059',1),(48,'Axetacy','<p><span style=\"background-color:#ffffff\"><span style=\"color:#f44336\"><span style=\"color:#000000\">A solo guitar competition for both acoustic and electric guitars.</span></span></span></p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'NA',2),(49,'Aandholika','<p style=\"margin-left:0cm; margin-right:0cm\">Andholika is a talent hunt for the most versatile singer amongst the participants.</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Deepak Vasudevan 9483428953',2),(50,'Triathlon','<p style=\"margin-left:0cm; margin-right:0cm\">Triathlon, as the name suggests, is an amalgamation of three tasks involving wits, courage and presence of mind.</p>\r\n\r\n<p style=\"margin-left:0cm; margin-right:0cm\">This edition of Triathlon will help you explore the depths of ideas behind counter-culture.</p>\r\n\r\n<p style=\"margin-left:0cm; margin-right:0cm\">Be it racking your brains or performing challenging tasks, you have to be on your toes to nail this one.</p>\r\n\r\n<p>Coordinating with your team will be vital, if you are planning to ace Triathlon.</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Piyush Bhatt- 8445006699  , Gaurav Sharma - 8587857267',9),(51,'Treasure Hunt','<p style=\"margin-left:0cm; margin-right:0cm\">Hidden messages, obscure ciphers, elaborate maps, buried cryptexes, encrypted audios and much more awaits you in your search for that hidden gold or the crazy murderer. In the dead of night, beware of cloaked figures, laughing skulls, thundering drums or momentary signals in the sky as you find yourself embroiled in this vintage treasure hunt. So gather ye wits, pencils and running shoes, o villagers! Clues shall guide, fiends shall misguide and treasure shall beckon and whisper through the chilly air, &ldquo;Finders keepers!</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Nidheesh S  9656010973',9),(53,'Protest Out of Waste Redefined','<p><span style=\"color:#f44336\"><span style=\"color:#000000\"><span style=\"color:black\"><span style=\"color:#222222\">Teams can participate in groups of 3-6 </span></span></span></span>to make a masterpiece out of waste. While we provide you with limited resources, win short fun games to get more.</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'NA',8),(55,'Mr. and Ms. Oasis','<p style=\"margin-left:0cm; margin-right:0cm\">The title event for OASIS.</p>\r\n\r\n<p style=\"margin-left:0cm; margin-right:0cm\">Think you&#39;ve got what it takes to prove your art supreme? Sublime? How about finding out what the crowd thinks about you? Mr. and Miss. OASIS combs OASIS for the most talented people and puts them on a stage. Where you choose to fall down the pecking order, you decide.</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Arihant Jain: 7042676330 , Samiksha Gurbaxani: 8003583068',9),(61,'Beg Borrow Steal','<p><span style=\"color:#f44336\"><span style=\"color:#000000\"><span style=\"color:#000000\">You think you&rsquo;ve got everything you need? Think Again. Prepare to use all your resources and brainpower to fetch the most ridiculous, unfathomable and extraordinary things possible from a list of items given to you. Each object on this list earns you specified points and the team with the highest points wins. Beware. This event is a race against time as much as the other teams. </span></span></span></p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Nidheesh S    9656010973',9),(62,'Splash','<p><span style=\"color:#f44336\"><span style=\"color:#000000\">Every face is a blank canvas and the true expressions are portrayed only when it is tinted in the right shade. Participate in splash; face and hand painting competition.</span></span></p>','NA','','','-> Maximum team size is 4. \r\n-> This is a face/hand painting event.\r\n-> One member of the team has to volunteer to get his/her face and hands painted by the rest of the team.\r\n-> All inventories will be provided.\r\n-> The painting must be based on one of the themes announced during the event and must be finished within the stipulated time. \r\n-> At the end of the time duration, the participants must explain the work to the judges.\r\n-> Judgement will be based on creativity, detailing, painting skills and the overall outlook of the art work.',0,'','TBA','TBA','TBA',0,0,0,0,'Arushi Choudhary  7258998160',8),(63,'Contrasto','<p>The most colourful combination in the world is black and white &ndash; it contains all colours and at the same time excludes all. A Sketching Competition for all enthusiasts. Get your grey cells working and convert a white paper into a masterpiece!</p>','NA','','','->Each participant will be provided with a drawing sheet- half of it being black and the other half being white, along with other inventories. He/she will have to draw something related to a certain theme using black and white charcoal/chalk provided to him/her.\r\n\r\n->The participant will also have to give a written explanation about the art work in around 50 words.\r\n\r\n->The judging will be based on beauty, skill, clarity of explanation and relevance to the theme.',0,'','TBA','TBA','TBA',0,0,0,0,'NA',8),(64,'Canvas Street','<p>Be ready to get arrested for your art crimes this Oasis! CrAC brings to you the second edition of the semi graffiti competition, Canvas Street. Choose your partners in crime wisely and set your imagination free with wild styles and back jumps!</p>','NA','','','-> Teams of 2 to 3.\r\n-> Teams will be registered on first come first serve basis.\r\n-> Teams can improvise the sketch with their own details to the theme, and medium of their own choice if available. \r\n-> Submissions will be judged on skills, and creativity.\r\n-> Decision of the club will be final. \r\nThe Event:\r\n-> Each team will be provided with 6 primary colours (in limited amounts), a set of 1 round and 1 flat brush, charcoal, and chalk, along with basic stationary. \r\n-> Teams will be provided with a 3ft X 5ft (portrait orientation chart) panel.\r\n-> Teams are required to be prepared with a design prior to the event.\r\n-> Time limit: 2hours.\r\n-> In case of any damage caused to the campus property, the teams involved will have to pay a fine, the amount of which shall be decided by CrAC, depending on the extent of damage.\r\n-> Inventory brought by participants on their own needs to be cleared through club before the event commences.',0,'','TBA','TBA','TBA',0,0,0,0,'Arushi Choudhary  7258998160',8),(65,'Trailer Making','<p>NA</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'NA',6),(66,'Story Completion','<p>NA</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'NA',6),(67,'Metamorphosis','<p><span style=\"color:#222222\"><span style=\"background-color:#ffffff\">Metamorphosis is&nbsp;a theme based short film making competition,&nbsp;where aspiring film makers showcase their talent through their aesthetic sense, ingenuity,&nbsp;perspective and emotion. Every year we get multiple entries and the best of them are selected for the final round during Oasis. </span></span></p>','NA','','Shortlisting of 10 finalists by October 27th, Finals during Oasis.','->First 5 seconds of the movie should display the title, team name, team members\' name(s) and the line \"This movie is solely made for Metamorphosis, Oasis \'18\".\r\n->The movie should be in Hindi or English or both. Subtitles are mandatory for movies of both languages.\r\n->Please note that Oasis/Metamorphosis/Film Making Club will not be responsible for postal delays, losses or damages. Make sure you send in the entries sufficiently before the deadline. \r\n->You may use any video camera you deem suitable for shooting the movie.\r\n->Entries must be the original work of the entrant and must not infringe third-party\'s rights.\r\n->The content of the movie should be appropriate for public screening.\r\n->Obscenity (at the discretion of the judges) of any kind is not allowed.\r\n->Plagiarism is strictly prohibited. Sound tracks and stock footage can be borrowed, but with due credits.\r\n->The decision of the judges will be final and binding.',0,'','TBA','TBA','TBA',0,0,0,0,'Jays Jose Thomas - 8209271442  Kaustubh Dwivedi  9636948333  Achintya Tewari  9740650739',6),(68,'Apt to Act','<p><span style=\"color:#f44336\"><strong><span style=\"color:#000000\">How sobered is Shakespeare when he says, &#39;All the world&#39;s a stage, and all the men and women merely actors&rsquo;? Where do you see yourself in an unforeseen situation from your day-to-day life of concealing actors around? How creative and spontaneous are you to handle such everyday plots? There is no better time than OASIS, to bring out the actor in one on a real stage. </span></strong></span></p>\r\n\r\n<p><strong><span style=\"color:#000000\">Apt to Act is an impromptu acting competition wherein teams of two will be given a scene from a famous movie with dialogues. 10 teams will be shortlisted for the second round which will involve enacting a particular situation.</span></strong></p>','NA','','','->Each team can have 2 to 3 participants\r\n->Teams are expected to report 15 min before the event begins\r\n->Order of participation will be based on lucky draw.\r\n->In first round, situations are given on spot for each group with an act-time of 10 minutes. The theme for       further rounds will be revealed at the time of event.\r\n->Score awarded for dialogues-action-presentation-creativity-spontaneity.\r\n->Use of vulgar language or action of any sort will lead to immediate disqualification.\r\n->Teams can act in English or Hindi.\r\n->Accessing the internet is not allowed.\r\n->Situations to be enacted will be given by the judges and the decision of judges will be final.',0,'','TBA','TBA','TBA',0,0,0,0,'Damanjot Singh - +918966911000  Ashwin Saxena - +919910272285   Simran Sehgal - +919810618397',6),(69,'Ad/ Poster Making','<p>NA</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'NA',6),(70,'Street Play','<p><span style=\"color:#f44336\"><strong><span style=\"color:#000000\">Street Plays aka Nukkad Natak, are carried out to propagate social and political messages among the masses, amidst the direct, intimate and effective means of theatre by means of shouts, chants, drums and catchy songs.</span></strong></span></p>\r\n\r\n<p>&nbsp;</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Shravan +91- 9833010506',5),(71,'Stage Play','<p><span style=\"color:#f44336\"><strong><span style=\"color:#000000\">The Stage Play event brings you a wholesome feat of drama to awaken and thrill your senses. It gives you a chance to captivate your audience with your actions and expressions and to watch and perform captivating plays</span><span style=\"color:#000000\">.</span></strong></span></p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Chitranjan +91- 8627970596',5),(73,'FashP','<p><span style=\"background-color:#ffffff\"><span style=\"color:#f44336\"><span style=\"color:#f44336\"><span style=\"color:#000000\">What is Fashion? In a world like ours, where almost everyone is so obsessed with how they look, is it overstating things to say that it is an art, or a religion perhaps? Fashion, for some, is the signature of one&#39;s personality, while for others, it is a means to disguise their true personality. Whatever be your reason, if you love fashion, </span><span style=\"color:#000000\"><em>FashP </em></span><span style=\"color:#000000\">is just the right place for you. </span></span></span></span></p>\r\n\r\n<p><span style=\"color:#000000\"><em>FashP</em></span><span style=\"color:#000000\">, short for Fashion Parade, is an event usually held on the last day of Oasis in the main auditorium of BITS Pilani. The auditorium is usually packed with BITSians and outstation guests who come to watch as beautiful models parade before them in never-seen-before designs made by ingenious designers looking for an avenue to showcase their talents. For those who like merely spectating, it is just the right kind of show. One thing is for sure: &nbsp;this event is going to be an ethereal experience for all fashion-lovers.</span></p>\r\n\r\n<p>&nbsp;</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Aishwarya - +91-7073512264',4),(74,'Tandav','<p><span style=\"background-color:#ffffff\"><span style=\"color:#f44336\"><span style=\"color:#000000\">Tandav is a classical dance contest. It invites participants trained in Odissi, Kathak, Kuchipudi, Bharatanatyam, Manipuri, Kathakali, Mohiniattam and Sattriya.</span></span></span></p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Megha Paliwal- +91-8209147411, +91-8955464507 , Chirag Pathak- +91-9131984337',3),(75,'Street Dance','<p><span style=\"background-color:#ffffff\"><span style=\"color:#f44336\"><span style=\"color:#000000\">As the name suggests, Street Dance is a street-style dance event organized by the Department of Theatre. It features performances by teams from colleges around the country. Street Dance is considered a crowd favorite and is held in the Rotunda, the open-air amphitheater of BITS. After the initial elimination round, about eight to ten teams are shortlisted for the final round. The first stage of the final round features street-style performances by the participating teams. The second stage of the final round is a face-off challenge between pairs of teams. Teams are judged on the basis of their choreography, synchronization, footwork, and power moves, along with costume, innovation and overall impact.</span></span></span></p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'NA',3),(76,'Razzmatazz','<p><span style=\"color:#f44336\"><span style=\"color:#000000\">Razzmatazz is a one-of-its-kind group dance competition that tests finesse and artistry in showcasing coordinated group choreography. With equal weightage in judgement given to execution, presentation and creativity, it is fashioned to test the esprit de corps of the participating teams. All forms of dance including fusions are allowed. So trip the light fantastic toe and let there be a razzle-dazzle of sheer splendor.</span></span><br />\r\n&nbsp;</p>','NA','','','->Maximum team strength allowed is 25 dancers.\r\n->On stage maximum 14 members allowed at a time. Rest can rotate between rounds.\r\n->A maximum of 22 teams can participate in the event.\r\n->The final event will consist of 3 rounds.',0,'','TBA','TBA','TBA',0,0,0,0,'Parikshit Parate  7240466917/8007883949',3),(77,'Desert Duel','<p style=\"margin-left:0cm; margin-right:0cm\">It is a solo dance event in which dancers from every college participate and showcase their talent. Depending on the dancer, styles can vary from western to classical to hip-hop and even to the typical Bollywood style.</p>','NA','','','->A maximum of 6 entries per college.\r\n->Individual participation.\r\n->The event comprises of eliminations followed by finals.',0,'','TBA','TBA','TBA',0,0,0,0,'Rudraj Mehta  9983086838/ 9429169124',3),(78,'Choreo','<p style=\"margin-left:0cm; margin-right:0cm\"><span style=\"background-color:white\"><span style=\"color:#222222\">Choreo is a dance event which features contemporary dance performances by teams from colleges around the country. This event is conducted in the central auditorium. After the initial elimination round, about six to eight teams are shortlisted for the final round. The final round features contemporary dance performances that are usually based on a certain theme.</span></span></p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Jaanvi +91-8200127872',3),(79,'VLOG MAKING','<p>Vlog making competition is a competition in which contestants have to make a v-log of the 5 days of Oasis in a creative and artistic sense, also justifying the theme and submit the entries 2 days after the completion of the fest.</p>','NA','','','->Time Limit: 1-5 minutes (Including credits)\r\n->The video should be in Hindi or English or both. \r\n->Use of vulgar language or action of any sort will lead to immediate disqualification.\r\n->Sound tracks and stock footage can be borrowed, but with due credits.\r\n->Entries must be the original work of the entrant and must not infringe third-party\'s rights.\r\n->Please note that Oasis/Metamorphosis/Film Making Club will not be responsible for postal delays, losses or damages. Make sure you send in the entries sufficiently before the deadline',0,'','TBA','TBA','TBA',0,0,0,0,'Damanjot Singh, +918966911000   Jared Dominic Fernandez - +919061355311   Eashan - 9370141298',6),(80,'ASTROGRAPHY','<p style=\"margin-left:0cm; margin-right:0cm\">It&rsquo;s a photography competition where participants take pictures of the sky and other celestial objects using their mobile phones and come up with witty captions for their photos to go along with the Oasis theme. This shall be held on FD-3 Terrace as well, in parallel with The Night&rsquo;s Watch. The event will be for 4 hours.</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Vigynesh Bhatt 9582967409',9),(81,'BITS Pilani Open Mic','<p style=\"margin-left:0cm; margin-right:0cm\"><span style=\"color:#222222\">The BITS Pilani Open Mic is the perfect platform for budding standup comedians to get over their stage fears and showcase their knack for savagery and humor.</span></p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Devansh  7987023229',13),(82,'Improv Comedy Competition','<p>Exploring the most unconventional form of comedy, the Improv Comedy Challenge involves participants in exciting fast-paced improv games, hilarious stories, scenes, and songs right on the spot and in the moment.</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Devansh  7987023229',13),(83,'Tambola Tales','<p style=\"margin-left:0cm; margin-right:0cm\"><span style=\"background-color:white\"><span style=\"color:#222222\">An event to satisfy all your cravings for composing pieces related to poetry, story, rap or songs of your own. One can enjoy here the game of housie along with the fun of debating and composing.</span></span></p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Sashank - 6375352568 ,  Aman - 9472839032',8),(84,'TRIPPED: A VR Gaming Event','<p style=\"margin-left:0cm; margin-right:0cm\">Feeling yourself loosen up like a hippie? Or loud and energetic like a Punk? This Oasis experience the counterculture inside you and fight others in the grand cultural festival.</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'Aman Kumar +91-9829915088',9),(85,'Comedy Talk Show','<p>NA</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'NA',13),(86,'Galleria','<p>Come, experience a transcendental journey through your own self as you traverse through poems, stories and artworks. Traverse through the minds of performers, past and present.</p>','NA','','','',0,'','TBA','TBA','TBA',0,0,0,0,'NA',8);
